del: MyComponent; // objeto asignado en el formulario sobre el que se realizan los cambios\n  @Input() compImgsInDB: string[];\n\n  @Input() images; // imgenes subidas a travs de los inputs[file]\n  @Input() imagesNames: string[]; // nombres de las imgenes subidas\n\n  @ViewChild('sysImgInput')\n  sysImgInput!: ElementRef; // input[file] del sistema famoso\n  @ViewChild('compImgInput')\n  compImgInput!: ElementRef; // input[file] de las imgenes del componente\n\n  priceUnits: string[] = Object.values(PriceUnits); // unidades de moneda\n\n  constructor() { }\n\n  ngOnInit(): void {\n  }\n\n  getActualYear() {\n    return new Date().getFullYear();\n  }\n\n  /**\n   * \n   * @returns si el componente es usado en dispositivos de escritorio\n   */\n  isDesktop() {\n    return this.model.component_devices.split(',').includes(CompDevices.desktop);\n  }\n\n  /**\n   * \n   * @returns si el componente es usado en dispositivos porttiles\n   */\n  isPortable() {\n    return this.model.component_devices.split(',').includes(CompDevices.portable);\n  }\n\n  /**\n   * Cambia la unidad de moneda seleccionada en el combobox\n   * @param u : nueva unidad de moneda seleccionada\n   */\n  changePriceUnits(u: string) {\n    this.model.component_price_units = this.priceUnits.filter((e) => e === u)[0];\n  }\n\n  /**\n   * Cambia la seleccin realizada en el tipo de dispositivos\n   * @param portable : valor de seleccin del checkbox correspondiente a dispositivos porttiles\n   * @param desktop : valor de seleccin del checkbox correspondiente a dispositivos mviles\n   */\n  onChange(portable: boolean, desktop: boolean) {\n    if (portable && desktop) this.model.setDevices([CompDevices.portable, CompDevices.desktop]);\n    else if (portable) this.model.setDevices([CompDevices.portable]);\n    else if (desktop) this.model.setDevices([CompDevices.desktop]);\n    else this.model.setDevices([]);\n  }\n\n  /**\n   * Aade (o reemplaza si ya existe) la imagen seleccionada correspondiente al sistema famoso\n   * @param e : subida de archivos en el input[file]\n   */\n  sysImgChange(e: Event) {\n    // obtiene el archivo subido\n    let element = e.target  as HTMLInputElement;\n    let fileList: FileList | null = element.files;\n    if (fileList && fileList.length == 1) {\n      var reader = new FileReader();\n      reader.onload = (event:any) => {\n        // saca el ndice correspondiente a la imagen y su nombre en los respectivos arrays\n        let i = this.imagesNames.indexOf(this.model.famous_system_img.split('.')[0]);\n        // si ya existe en el array se reemplaza la imagen\n        if (i != -1) this.images[i] = event.target.result;\n        // si no existe se aade\n        else this.images.push(event.target.result);\n      }\n      reader.readAsDataURL(fileList[0]);\n      // se divide el nombre para obtener el nombre con el que se va a guardar y la extensin\n      let fileNameExt = fileList[0].name.split('.');\n      let saveName = fileNameExt[0] + '.' + ((fileNameExt[fileNameExt.length - 1] == 'jpg') ? 'jpeg' : fileNameExt[fileNameExt.length - 1]);\n      // si exista previamente otra imagen reemplazamos el nombre en el array\n      if (this.model.famous_system_img) {\n        this.compImgsInDB.forEach((img, index) => { // si exista en la base de datos\n          if (img === this.model.famous_system_img) {\n            this.compImgsInDB.splice(index,1);\n          }\n        });\n        let i = this.imagesNames.indexOf(this.model.famous_system_img.split('.')[0]); // si haba sido subida\n        if (i != -1) this.imagesNames[i] = fileNameExt[0];\n        else this.imagesNames.push(fileNameExt[0]);\n      } // si no existe se aade \n      else this.imagesNames.push(fileNameExt[0]);\n      // se asigna el nombre y la extensin del archivo que se va a subir\n      this.model.famous_system_img = saveName;\n    }\n    // resetea el valor del input\n    this.sysImgInput.nativeElement.value = '';\n  }\n\n  /**\n   * Aade las imgenes seleccionadas para el componente\n   * @param e : subida de archivos en el input[file]\n   */\n  compImgsChange(e: Event) {\n    // obtiene los archivos subidos\n    let element = e.target  as HTMLInputElement;\n    let fileList: FileList | null = element.files;\n    if (fileList && fileList.length > 0) {\n      for (let i = 0; i  {\n            this.images.push(event.target.result);\n          }\n          reader.readAsDataURL(fileList[i]);\n          // se aade el nombre de la imagen\n          this.imagesNames.push(fileNameExt[0]);\n          // asigna el nombre \n          this.model.component_imgs.push(saveName);\n        }\n      }\n    }\n    // resetea el valor del input\n    this.compImgInput.nativeElement.value = '';\n  }\n\n  /**\n   * Elimina una imagen de entre las recin aadidas al componente\n   * @param name : imagen que se va a eliminar\n   */\n  removeImage(name: string) {\n    // obtiene el ndice de la imagen en los arrays correspondientes\n    let index = this.images.indexOf(name);\n    if (index != -1) {\n      // obtiene el nombre con el que se guarda dicha imagen\n      let imgName = this.imagesNames[index];\n      // elimina la imagen de ambos arrays\n      this.images.splice(index, 1);\n      this.imagesNames.splice(index, 1);\n      // elimina la imagen del componente\n      this.model.component_imgs.forEach((img, ind) => {\n        if (img.split('.')[0] === imgName)\n          this.model.component_imgs.splice(ind,1);\n      });\n    }\n  }\n}\n\n    \n\n    \n        \n    Nombre:\n    \n        \n        Complete este campo\n    \n        \n\n    Descripcin:\n    \n        \n        Complete este campo\n    \n\n\n    Familia:\n    \n        \n        Complete este campo\n    \n\n\n    Ao de salida:\n    \n        \n        Min: 1900, max: {{getActualYear()}}\n        Complete este campo\n    \n    Ao de fin:\n    \n        \n        Min: 1900, max: {{getActualYear()}}\n        Complete este campo\n    \n\n -->\n    Precio:\n    \n        \n        Complete este ca